const memberCards = [
  {
    name: "Wonmin Lee",
    age: 28,
    job: "Game Developer",
    japaneseName: "ウォンミン・リー",
    image: {
      url: "/images/test.jpg",
    },
  }
]

export function getRandomMember(){
  return memberCards[Math.floor(Math.random() * memberCards.length)];
}
